description:
Working out is something Josephine really likes to do. She loves to keep healthy and fit. Den feels the same way, but his version of exercise is slightly different than Josephine's. Luckily for him, she is open to doing anything that allows her to work up a sweat and keep her body in peak condition. She's already warm when he arrives and it doesn't take long for her to get even warmer. Her workout bench is perfect for what they want to do and they really do put it to the test. Her pussy feels so good and she loves having him inside of her. It doesn't take long for her to realize that she much prefers this kind of workout instead. :) Come on in and see for yourself how these two break a sweat and get all the exercise they need for the day... enjoy!

